import React from 'react';
import './UpdateApartment.css';

const UpdateApartment = ({ show, handleClose }) => {
    return (
        <div className={`modal ${show ? 'show' : ''}`} 
             style={{ display: show ? 'block' : 'none', backgroundColor: 'rgba(0, 0, 0, 0.5)' }} 
             tabIndex="-1" 
             role="dialog">
            <div className="modal-dialog modal-dialog-centered" role="document">
                <div className="modal-content">
                    <div className="modal-header">
                        <h5 className="modal-title">Update Apartment</h5>
                        <button type="button" className="close" onClick={handleClose}>
                            <span aria-hidden="true">&times;</span>
                        </button>
                    </div>
                    <div className="modal-body">
                        <p>Enter information to update the apartment.</p>
                        
                        <div className="form-group">
                            <label htmlFor="garage">Garage Count</label>
                                <input
                                type="number"
                                className={`form-control'is-invalid' ''}`}
                                id="garage"
                                name="garage"
                                placeholder="Garage Count"
                                min="1"/>
                  
                </div>

                        {/* Място за формуляра за актуализация */}
                    </div>
                    <div className="modal-footer">
                        <button type="button" className="btn btn-primary">Save changes</button>
                        <button type="button" className="btn btn-secondary" onClick={handleClose}>Close</button>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default UpdateApartment;
